comment:
On or before Sep 23, 2008 this sequence version replaced
            gi:74758086, gi:66362.
            [FUNCTION] Destroys radicals which are normally produced within the
            cells and which are toxic to biological systems.
            {ECO:0000269|PubMed:24140062}.
            [CATALYTIC ACTIVITY] Reaction=2 H(+) + 2 superoxide = H2O2 + O2;
            Xref=Rhea:RHEA:20696, ChEBI:CHEBI:15378, ChEBI:CHEBI:15379,
            ChEBI:CHEBI:16240, ChEBI:CHEBI:18421; EC=1.15.1.1;
            Evidence={ECO:0000269|PubMed:24140062}.
            [COFACTOR] Name=Cu cation; Xref=ChEBI:CHEBI:23378;
            Evidence={ECO:0000269|PubMed:17888947}; Note=Binds 1 copper ion per
            subunit. {ECO:0000269|PubMed:17888947}.
            [COFACTOR] Name=Zn(2+); Xref=ChEBI:CHEBI:29105;
            Evidence={ECO:0000269|PubMed:17888947}; Note=Binds 1 zinc ion per
            subunit. {ECO:0000269|PubMed:17888947}.
            [SUBUNIT] Homodimer; non-disulfide-linked (By similarity).
            Homodimerization may take place via the ditryptophan cross-link at
            Trp-33. Heterodimer with SOD1 (PubMed:31292775). The pathogenic
            variants ALS1 Arg-38, Arg-47, Arg-86 and Ala-94 interact with
            RNF19A, whereas wild-type protein does not. The pathogenic variants
            ALS1 Arg-86 and Ala-94 interact with MARCH5, whereas wild-type
            protein does not. The heterodimer CCS:SOD1 interacts with SLC31A1;
            this heterotrimer is Cu(1+)-mediated and its maintenance is
            regulated through SOD1 activation (PubMed:31292775).
            {ECO:0000250|UniProtKB:P08228, ECO:0000269|PubMed:10329151,
            ECO:0000269|PubMed:12911296, ECO:0000269|PubMed:12963370,
